import React, { useState } from 'react';
import { Link, useLocation } from 'react-router-dom';
import './Header.css';

const Header = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [currentLanguage, setCurrentLanguage] = useState('FR');
  const location = useLocation();

  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  const closeMenu = () => {
    setIsMenuOpen(false);
  };

  const toggleLanguage = () => {
    setCurrentLanguage(currentLanguage === 'FR' ? 'EN' : 'FR');
  };

  return (
    <header className="header">
      <div className="header-container">
        <Link to="/" className="logo-section" onClick={closeMenu}>
          <img 
            src="/TGBC.jpg" 
            alt="TUNISIAGBC Logo" 
            className="logo-image"
          />
          <div className="logo-text">
            <h1 className="logo-acronym">TUNISIAGBC</h1>
            <div className="logo-arabic">مجلس تونس للأبنية الخضراء</div>
            <div className="logo-english">TUNISIA GREEN BUILDING COUNCIL</div>
          </div>
        </Link>

        <nav className={`nav ${isMenuOpen ? 'nav-open' : ''}`}>
          <ul className="nav-list">
            <li className="nav-item">
              <Link 
                to="/about" 
                className={`nav-link ${location.pathname === '/about' ? 'active' : ''}`}
                onClick={closeMenu}
              >
                À propos
              </Link>
            </li>
            <li className="nav-item">
              <Link 
                to="/members" 
                className={`nav-link ${location.pathname === '/members' ? 'active' : ''}`}
                onClick={closeMenu}
              >
                Membres & Partenaires
              </Link>
            </li>
            <li className="nav-item">
              <Link 
                to="/programs" 
                className={`nav-link ${location.pathname === '/programs' ? 'active' : ''}`}
                onClick={closeMenu}
              >
                Programmes & Initiatives
              </Link>
            </li>
            <li className="nav-item">
              <Link 
                to="/events" 
                className={`nav-link ${location.pathname === '/events' ? 'active' : ''}`}
                onClick={closeMenu}
              >
                Événements
              </Link>
            </li>
            <li className="nav-item">
              <Link 
                to="/resources" 
                className={`nav-link ${location.pathname === '/resources' ? 'active' : ''}`}
                onClick={closeMenu}
              >
                Ressources
              </Link>
            </li>
            <li className="nav-item">
              <Link 
                to="/news" 
                className={`nav-link ${location.pathname === '/news' ? 'active' : ''}`}
                onClick={closeMenu}
              >
                Actualités
              </Link>
            </li>
            <li className="nav-item">
              <Link 
                to="/contact" 
                className={`nav-link ${location.pathname === '/contact' ? 'active' : ''}`}
                onClick={closeMenu}
              >
                Contact
              </Link>
            </li>
          </ul>

          <div className="header-actions">
            <Link to="/contact" className="btn btn-primary" onClick={closeMenu}>
              Devenir membre
            </Link>
            <div className="language-switcher">
              <button 
                className={`lang-btn ${currentLanguage === 'FR' ? 'active' : ''}`}
                onClick={() => setCurrentLanguage('FR')}
              >
                FR
              </button>
              <span className="lang-separator">|</span>
              <button 
                className={`lang-btn ${currentLanguage === 'EN' ? 'active' : ''}`}
                onClick={() => setCurrentLanguage('EN')}
              >
                EN
              </button>
            </div>
          </div>
        </nav>

        <button 
          className={`menu-toggle ${isMenuOpen ? 'menu-open' : ''}`}
          onClick={toggleMenu}
          aria-label="Toggle menu"
        >
          <span></span>
          <span></span>
          <span></span>
        </button>
      </div>
    </header>
  );
};

export default Header;
